import './App.css';

function App() {
  return (
    <div className="App">
      <svg viewBox="0 0 160 20" style={{height: "20vw", maxWidth: "50vw", backgroundColor: "red"}} wihexmlns="http://www.w3.org/2000/svg" >

        <text x="10" y="0" class="pixelFont" style={{stroke: "black", strokeWidth: "0.1vw"}}>Zombie Fighter Redux</text>
        <text x="10" y="0" class="pixelFont" style={{fill: "white"}}>Zombie Fighter Redux</text>
      </svg>
    </div>
  );
}

export default App;
